import 'destyle';
import { styled } from '@stitches/react';
import { Sideber , Menu , Note } from './components';

const StyledBody = styled('body', {
  width : '80%',
  height : '80%',
  display : 'flex',
  border : 'solid 1px black',
});

function App() {
  return (
    <StyledBody>
      <Sideber />
      <Menu />
      <Note />
    </StyledBody>
  );
}

export default App;
